import {Route,Routes} from "react-router-dom"
import Footer from "./Comp/Footer";
import Home from "./Comp/Home";
import NavBar from "./Comp/NavBar";

function App() {
  return (
    <div>
      <NavBar/>
      <Routes>
        <Route path="/" element={<Home/>}></Route>
        <Route path="/Login" element={<Home/>}></Route>
      </Routes>
      <Footer/>

    </div>
  );
}

export default App;
